data.text:
@Lola_Lolilla @ppucedac Yo creo que es obvio que es un personaje. 

Yo no me levanto por las mananas y me preparo un bocadillo con 4 litros de aceite, mayonesa y chocolate jaja.

Vamos, no creo que sea una figura representativa, sino una mas de estas virales de internet. Muchos ni saben de donde es.
